import React, {useEffect, useState} from "react";
import {useDispatch, useSelector} from "react-redux";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faSpinner} from "@fortawesome/free-solid-svg-icons";

const Extension = () => {
    const callFlowsData = useSelector(state => state.callFlowsData);
    const loading = useSelector(state => state.loadingStatus);
    const [loadingStatus, setLoadingStatus] = useState(true);

    const dispatch = useDispatch();
    useEffect(() => {
        setLoadingStatus(false);
        dispatch({loadingStatus, type: "SET_LOADING_STATUS"});
    }, [callFlowsData]);
    return (

        <React.Fragment>
            {
                loading ? <FontAwesomeIcon className="fas fa-spinner fa-spin" icon={faSpinner}/> :
                    <table className="table table-sm table-striped table-bordered table-hover">
                        <thead>
                        <tr>
                            <th>Extensions</th>
                        </tr>
                        </thead>
                        <tbody>{
                            callFlowsData.item === undefined ? null : callFlowsData.item[0].data[0].numbers.map((item, i) => {

                                return (
                                    <tr key={i}>

                                        <td>
                                            {item}
                                        </td>
                                    </tr>
                                )

                            })
                        }</tbody>
                    </table>} </React.Fragment>
    )

};


export default Extension;
